import { Component } from '@angular/core';
import {httpRequests} from "../http";
import {AbstractControl, FormControl, FormGroup, Validators} from "@angular/forms";
import {Observable} from "rxjs";

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  constructor(private Request:httpRequests) {
  }
  group=new FormGroup({
    email:new FormControl(null,[Validators.required,Validators.email],this.restricted.bind(this)),
    password:new FormControl(null,[Validators.required,Validators.minLength(8)])
  });
  UserDoesNotExist(UserData:any,UserInput:any):Boolean{
    let UserExists:Boolean=false;
    let i=0;
    while(i < UserData.length && UserExists == false){
      if(UserInput==UserData[i].email){
        UserExists=true;
      }else{
        i++;
      }
    }

    return UserExists;
  }
  restricted(control:AbstractControl):Promise<any>|Observable<any>{
    let UserData:any;
    this.Request.GetAllUsers().subscribe((data)=>{
      UserData=data;

    })
    let promise = new Promise((resolve, reject) => {

      setTimeout(() => {
        let UserInput = control.value;
        if(this.UserDoesNotExist(UserData,UserInput)==false){
          resolve({error:false})
        }else{
          resolve(null);
        }



      }, 1000)
    });
    return promise;
  }
  submit(){
    console.log(this.group)
  }

}
<!doctype html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport"
        content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Login</title>
  <script src="https://code.jquery.com/jquery-3.7.0.js" integrity="sha256-JlqSTELeR4TLqP0OG9dxM7yDPqX1ox/HfgiSLBj8+kM=" crossorigin="anonymous"></script>
</head>
<body>
<div class="row">
  <div class="mx-auto col-10 col-md-8 col-lg-6">
    <form [formGroup]="group" (ngSubmit)="submit()">
      <div class="form-group">
        <label for="exampleInputEmail1">Email address</label>
        <input formControlName="email" name="email" type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email">
        <p class="alert alert-danger p-1" *ngIf="group.get('email')?.hasError('required') && group.get('email')?.touched && group.get('email')?.dirty ">email is required</p>
        <p class="alert alert-danger p-1" *ngIf="group.get('email')?.hasError('email') && group.get('email')?.touched && group.get('email')?.dirty ">email is invalid</p>
        <p class="alert alert-danger p-1" *ngIf="group.get('email')?.errors?.['error']==false && group.get('email')?.touched && group.get('email')?.dirty ">email does not exist</p>

      </div>
      <div class="form-group">
        <label for="exampleInputPassword1">Password</label>
        <input formControlName="password"  name="password" type="password" class="form-control" id="exampleInputPassword1" placeholder="Password">
        <p class="alert alert-danger p-1" *ngIf="group.get('password')?.errors?.['required'] && group.get('password')?.touched && group.get('password')?.dirty ">password is required</p>
        <p class="alert alert-danger p-1" *ngIf="group.get('password')?.errors?.['minlength'] && group.get('password')?.touched && group.get('password')?.dirty ">Minimum length of password is 8</p>
      </div><br>
      <button routerLink="/home" type="submit" class="btn btn-primary mx-2">Login</button>
      <button type="button" class="btn btn-primary">Sign up</button>
    </form>
  </div>
</div>
</body>
</html>
